import { generate } from "@pdfme/generator";
import {useEffect} from "react";
export default function Pdf() {
    useEffect(() => {
      const queryString = window.location.search;
      const urlParams = new URLSearchParams(queryString);
      (async () => {
        const font = {
            serif: {
              data: await fetch('/Charm-Regular.ttf').then((res) => res.arrayBuffer()),
              fallback:true,
            },
          }
        const template = {
        "schemas": [
          {
            "field2": {
              "type": "text",
              "fontName":'serif',
              "position": {
                "x": 28.73,
                "y": 84.29
              },
              "width": 243.21,
              "height": 23.4,
              "alignment": "center",
              "fontSize": 60,
              "characterSpacing": 0,
              "lineHeight": 1,
              "backgroundColor": "#fcfcfc"
            },
            "field1": {
              "type": "text",
              "position": {
                "x": 101.35,
                "y": 121.71
              },
              "width": 63.3,
              "height": 7,
              "alignment": "center",
              "fontSize": 15,
              "characterSpacing": -1,
              "lineHeight": 1,
              "backgroundColor": "#fefbfc"
            },
            "field3": {
              "type": "text",
              "position": {
                "x": 166.16,
                "y": 121.97
              },
              "width": 34.2,
              "height": 7,
              "alignment": "center",
              "fontSize": 16,
              "characterSpacing": -1,
              "lineHeight": 1,
              "backgroundColor": "#fdf9fa"
            }
          }
        ],
        "basePdf": "data:application/pdf;base64,"
      };
        const inputs = [
        {
          "field2": urlParams.get("name"),
          "field1": urlParams.get("InstName"),
          "field3": urlParams.get("location")
        }
      ];
          
            const pdf = await generate({ template, inputs,options:{font} });
          
            // Node.js
            // fs.writeFileSync(path.join(__dirname, 'test.pdf'), pdf);
          
            // Browser
            const blob = new Blob([pdf.buffer], { type: 'application/pdf' });
            window.location = (URL.createObjectURL(blob));
          })();
    })
    return (
        <div className="pdf">
            <h1>Your requested PDF file is loading...</h1>
        </div>
    );
}

